Беговая дорожка Sprint ST600 Длина (см): 193,5 Ширина (см): 85 Высота (см): 130 Вес тренажера (кг): 93 Вес пользователя до (кг): 160 Размеры полотна (см): 50х143 Гарантия: на раму – 3 года, на двигатель – 2 года, на беговое полотно и электронику - 1 год. Беговая дорожка Sprint ST600 обладает высоким качеством и прекрасными техническими характеристиками, по умеренной цене! Угол наклона: регулируется электрически до 20%; Программы: 25 эффективных встроенных программ; Беговое полотно: 50см х 143см;
..........
гол наклона, программу; Быстрый доступ на правом поручне переключения скорости 3 кнопки: (3км/ч, 6 км/ч, 9 км/ч); Быстрый доступ на левом поручне переключения наклона дорожки 3 кнопки: (3%, 6%, 9%); Аудио вход для подключения MP3 плеера, смартфона; Два динамика 5W (отличное звучание колонок); Упрощенная система сборки! Складная конструкция; Транспортировочные ролики для удобного перемещения; Ключ безопасности; Измерение пульса: сенсорные датчики расположены на рукоятках; Габариты в сложенном сос
